import Col from 'react-bootstrap/Col';
import Container from 'react-bootstrap/Container';
import Image from 'react-bootstrap/Image';
import Row from 'react-bootstrap/Row';
import Card from 'react-bootstrap/Card';

const characters = [
  {name: 'Calamardo', state:true},
  {name: 'Da Vinci', state:true},
  {name: 'Dr. Simi', state:true},
  {name: 'Mul치n', state:true},
  {name: 'Mam치 Coco', state:true},
]

function Character() {
  return (
    characters.map((character => 
    <Container style={{margin:'10px', marginLeft:'90px'}}>
      <Row>
      <Col xs={5} md={2}>
          <Image style={{float:"left", width:'200px', height:'200px'}} src="https://th.bing.com/th/id/OIP.dy1K8v9RPpQOLR_N15e5QgHaFj?pid=ImgDet&rs=1" rounded />
          <Card.Title style={{textAlign:'center'}}>{character.name}</Card.Title>
        </Col>
      </Row>
    </Container>
    ))
  );
}

export default Character;
